  true,\n\t\"url\": null,\n\t\"notes\": \"The Non-VA Care Medical and Pharmacy System
  (FEE) automates the Veterans Health Administration (VHA) Fee for Service program.
  It authorizes and pays private physicians, hospitals, and pharmacists for products
  and services provided to Veterans approved for the program. Veterans are reimbursed
  through VistA Fee for medically-related expenses including travel. Information is
  entered into the VistA Fee system through Veterans Health Information Systems and
  Technology Architecture (VistA) online menus. VistA Fee is run at the Austin Information
  Technology Center and interfaces with the Financial Management System (FMS), the
  Beneficiary Identification and Records Locator System (BIRLS), and the VHA Work
  Measurement database (VWM), to produce payments, accounting updates, and reports.
  VistA Fee facilitates money management, master record updating, and input error
  resolution. Daily reports indicating all payments processed and erroneous input
  transactions are transmitted to approximately 170 Veterans Affairs Medical Centers
  (VAMCs). Letters are sent to Veterans on a monthly basis detailing payments made
  on their behalf to Non-VA Care Service providers. Monthly, quarterly, semi-annual
  and annual reports are sent to the Veterans Affairs Central Office (VACO) and VAMCs.
  The Non-VA Care Fee Basis Medical System is commonly referred to as Central FEE.\",\n\t\"license_title\":
